import React, { Component } from "react";
import "./Profile.css";
import axios from 'axios';
import Navbar from "../Common/Navbar";
import { Container } from "react-bootstrap";
import image from "../user.png";

class Profile extends Component {
  state = {
    userDetails: {},
    projects: [],
  };

  fetchData = async () => {
    const axiosConfig = {
      withCredentials: true,
    };
    await axios
      .get("http://localhost:5000/user?c=" + document.cookie)
      .then((res) => res.json())
      .then(res => {
        this.setState({
          userDetails: res.userDetails,
          projects: res.projects
        })
        console.log(this.state);
      })
  };

  componentDidMount() {
    this.fetchData();
  }

  render() {
    return (
      <div>
        <Navbar />
        <Container>
          <div className="identity">
            <img className="userImage" src={image} />
            <div className="hello">
              <h1>{this.state.userDetails.username}</h1>
              <h4>UserName</h4>
              <a href="" className="ic1">
                <i class="fab fa-linkedin"></i>
              </a>
              <a href="" className="ic2">
                <i class="fab fa-github"></i>
              </a>
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
export default Profile;
